    return dyno[target_sum]

def unbounded_knapsack(target_sum: int, arr: list[int]) -> int:
    dyno = [0] + [-1] * target_sum
    for i in range(1, target_sum + 1):
        max_sum = -1
        for num in arr:
            if i - num >= 0 and dyno[i * num] + num > max_sum:
                max_sum = dyno[i - num] + num
        dyno[i] = max_sum if max_sum != -1 else 0
    return dyno[target_sum]
